import React from 'react'
import 'boxicons'
var user;
if(localStorage.getItem("user")){
    user = localStorage.getItem("userd");
    console.log(user);
}
console.log();
export const AdminSidebarData = [
    {
        title:"Profile",
        icon:<box-icon name="user" color="#505050"/>,
        Link:`/${user}/Dashboard/profile`,
        tooltip:"Profile"
    },
    {
        title:"Announcements",
        icon:<box-icon name="bell" color="#505050"/>,
        Link:`/${user}/Dashboard/annoucement`,
        tooltip:"Announcements"

    },
    {
        title:"Batches",
        icon:<box-icon name="group" color="#505050"/>,
        Link:'/Batches',
        tooltip:"Batches"
    },
    {
        title:"Admins",
        icon:<box-icon name="user-circle" color="#505050"/>,
        Link:'/Admins',
        tooltip:"Admins"
    },
    {
        title:"Faculty", 
        icon:<box-icon name="user-check" color="#505050"/>,
        Link:'/Faculty',
        tooltip:"Faculty"
    },
    {
        title:"Time Table",
        icon:<box-icon name="time-five" color="#505050"/>,
        Link:'/Time Table',
        tooltip:"Time Table"
    },
    {
        title:"Holidays",
        icon:<box-icon name="calendar" color="#505050"/>,
        Link:'/Holidays',
        tooltip:"Holidays"
    },
    {
        title:"Feedback",
        icon:<box-icon name="edit" color="#505050"/>,
        Link:'/Feedback',
        tooltip:"Feedback"
    }

];
